CREATE TABLE IF NOT EXISTS "atlasnode" (
"id" serial PRIMARY KEY,
"WorldAreasKey" INT NULL,
"ItemVisualIdentityKey" INT NULL,
"MapsKey" INT NULL,
"AtlasRegionsKey" INT NULL,
"AtlasNodeKeys0" INT[] NULL,
"AtlasNodeKeys1" INT[] NULL,
"AtlasNodeKeys2" INT[] NULL,
"AtlasNodeKeys3" INT[] NULL,
"AtlasNodeKeys4" INT[] NULL,
"Tier0" INT NULL,
"Tier1" INT NULL,
"Tier2" INT NULL,
"Tier3" INT NULL,
"Tier4" INT NULL,
"DDSFile" TEXT NULL
);





CREATE TABLE "atlasnode" (
"id" serial PRIMARY KEY,
"AtlasNodeKey" INT NULL,
"WorldAreasKey" INT NULL,
"Name" TEXT NULL,
"AtlasRegionsKey" INT NULL,
"AtlasNodeKeys0" INT[] NULL,
"AtlasNodeKeys1" INT[] NULL,
"AtlasNodeKeys2" INT[] NULL,
"AtlasNodeKeys3" INT[] NULL,
"AtlasNodeKeys4" INT[] NULL,
"Tier0" INT NULL,
"Tier1" INT NULL,
"Tier2" INT NULL,
"Tier3" INT NULL,
"Tier4" INT NULL
);


CREATE TABLE "regions" (
"id" serial PRIMARY KEY,
"Name" TEXT NULL
);



CREATE TABLE new AS
SELECT unnestzero."Name", unnestzero.unnest, newatlas."Name" 
FROM unnestzero, newatlas
WHERE unnestzero.unnest = newatlas."id";